from odoo import fields, models,apiclass AccountMoveInherit(models.Model):    _inherit = 'account.move'    default_tags_ids = fields.Many2many(comodel_name="account.analytic.tag", string="Default Analytic Tags", required=False, )    @api.constrains('default_tags_ids')    def default_tags(self):        for line in self.invoice_line_ids:            if self.default_tags_ids.ids:                line.analytic_tag_ids = self.default_tags_ids.ids            else:                line.analytic_tag_ids=None    # def write(self, vals):    #     for line in self.invoice_line_ids:    #          line.analytic_tag_ids=self.default_tags_ids.ids    #    #     return super(AccountMoveInherit, self).write(vals)